import React from 'react';

const DeliveryPickupToggle = ({ selectedOption, setSelectedOption }) => (
  <div className="delivery-pickup-toggle">
    <div className="btn-group" role="group" aria-label="Delivery or Pickup toggle">
      <button
        type="button"
        className={`btn ${selectedOption === 'Delivery' ? 'active' : ''}`}
        onClick={() => setSelectedOption('Delivery')}
        style={{
          fontSize: '14px',
          fontWeight: selectedOption === 'Delivery' ? '600' : '400',
          minWidth: '90px'
        }}
      >
        Delivery
      </button>
      <button
        type="button"
        className={`btn ${selectedOption === 'Pickup' ? 'active' : ''}`}
        onClick={() => setSelectedOption('Pickup')}
        style={{
          fontSize: '14px',
          fontWeight: selectedOption === 'Pickup' ? '600' : '400',
          minWidth: '90px'
        }}
      >
        Pickup
      </button>
    </div>
  </div>
);

export default DeliveryPickupToggle;
